import React from "react";
import Typewriter from "typewriter-effect";
function Header() {
  return (
    <div id="main">
      <div className="pr-heading">
        <h2>LETS START YOUR</h2>
        <h2>
          {" "}
          <Typewriter
            style={{ color: "white" }}
            options={{
              strings: [
                "FITNESS COACH",
                "HEALTH COACH",
                "DIED PLANNER",
                "GYM TRAINER",
              ],
              autoStart: true,
              loop: true,
              deleteSpeed: 20,
            }}
          />
        </h2>
        <h1>
          <span>FITNESS</span> WITH <span>AJ</span>
        </h1>
        <span className="details">
          Make yourself healthy and fit with Aqib Javed Professional touch{" "}
        </span>
        <div className="header-btns">
          <a href="https://www.facebook.com/AJ4573/" className="header-btn">
            Facebook Page
          </a>
        </div>
      </div>
    </div>
  );
}
export default Header;
